    def operate(self, button_txt):
        """
        This method have responsibility for effectuating all the logic of calculator.
        :param button_txt: receive button_txt.
        :return: don't return anything.
        """
        if button_txt.isdigit() or button_txt in ('A', 'B', 'C', 'D', 'E', 'F', '00'):  # checking if button is a number
            if len(str(self._current_number)) <= 8:
                self._current_number += button_txt
        else:  # otherwise is a operator
            if button_txt in (u'', u'', '-', '+'):
                # have a responsibility insert in old number the current number and salve the operator.
                self._operator = button_txt
                self._old_number = self._current_number
                self._current_number = ''
            elif button_txt == 'AC':  # reset operation.
                self._current_number, self._old_number, self._operator, self._result_number = '', '', '', 0
            elif button_txt == 'CE':  # reset the current number
                self._current_number = ''
            elif button_txt == 'BACK':  # delete one digit
                self._current_number = self._current_number[:-1]
            elif button_txt == '=':
                # have a responsibility to perform a operate in old number and
                # current number using o operator salved.
                try:
                    if self._operator == u'':
                        try:
                            self._result_number = int(self._old_number, self._current_base) // \
                                                  int(self._current_number, self._current_base)
                        except ZeroDivisionError:
                            self._result_number = 'NAN'
                            return
                    if self._operator == u'':
                        self._result_number = int(self._old_number, self._current_base) * \
                                              int(self._current_number, self._current_base)
                    if self._operator == '-':
                        self._result_number = int(self._old_number, self._current_base) - \
                                              int(self._current_number, self._current_base)
                    if self._operator == '+':
                        self._result_number = int(self._old_number, self._current_base) + \
                                              int(self._current_number, self._current_base)
                except Exception:
                    self._current_number = 'UNKNOWN ERROR'
                else:
                    self._current_number = format(self._result_number, self._base_map[self._current_base])

    def pretty(self, num, n, split, fill=False):
        """
        This method have a responsibility for splitting continuous number strings.
        :param num: a number string.
        :param n: the length of every piece.
        :param split: the connecting-character.
        :param fill: whether fill in leading 0 or not.
        :return: return a pretty split number string.
        """
        if fill:
            num = (n - len(num) % n) * '0' + num
        num = num[::-1]
        return split.join([num[i:i + n] for i in range(0, len(num), n)])[::-1]

