    def switch_base(self, button_txt):
        """
        This method have a responsibility for switching current base.
        :param button_txt: receive the button_text
        :return: don't return anything.
        """
        # temporarily change self._current_number and self._old_number to decimal.
        if type(self._current_number) is str and self._current_number:
            self._current_number = int(self._current_number, self._current_base)
        if type(self._old_number) is str and self._old_number:
            self._old_number = int(self._old_number, self._current_base)
        if button_txt == 'HEX':
            self._current_base = 16
            self.btn_hex.setStyleSheet(self._SELECTED_BASE_STYLE)
            self.btn_dec.setStyleSheet(self._BASE_STYLE)
            self.btn_oct.setStyleSheet(self._BASE_STYLE)
            self.btn_bin.setStyleSheet(self._BASE_STYLE)
        elif button_txt == 'DEC':
            self._current_base = 10
            self.btn_hex.setStyleSheet(self._BASE_STYLE)
            self.btn_dec.setStyleSheet(self._SELECTED_BASE_STYLE)
            self.btn_oct.setStyleSheet(self._BASE_STYLE)
            self.btn_bin.setStyleSheet(self._BASE_STYLE)
        elif button_txt == 'OCT':
            self._current_base = 8
            self.btn_hex.setStyleSheet(self._BASE_STYLE)
            self.btn_dec.setStyleSheet(self._BASE_STYLE)
            self.btn_oct.setStyleSheet(self._SELECTED_BASE_STYLE)
            self.btn_bin.setStyleSheet(self._BASE_STYLE)
        elif button_txt == 'BIN':
            self._current_base = 2
            self.btn_hex.setStyleSheet(self._BASE_STYLE)
            self.btn_dec.setStyleSheet(self._BASE_STYLE)
            self.btn_oct.setStyleSheet(self._BASE_STYLE)
            self.btn_bin.setStyleSheet(self._SELECTED_BASE_STYLE)
        self.check_base()
        if type(self._current_number) is int:
            self._current_number = format(self._current_number, self._base_map[self._current_base])
        if type(self._old_number) is int:
            self._old_number = format(self._old_number, self._base_map[self._current_base])
        self.display_calc.setText(self.pretty(str(self._current_number), 4 if self._current_base in (2, 16) else 3,
                                              ',' if self._current_base == 10 else ' '))

    def set_diff_bases(self):
        """
        This method have a responsibility for calculating and setting the corresponding results in different bases.
        :return: don't return anything.
        """
        if not self._current_number:
            self.btn_hex.setText("{0:<8}".format('HEX'))
            self.btn_dec.setText("{0:<8}".format('DEC'))
            self.btn_oct.setText("{0:<8}".format('OCT'))
            self.btn_bin.setText("{0:<8}".format('BIN'))
            return

        self.btn_hex.setText("{0:<8}".format('HEX') +
                             self.pretty(format(int(self._current_number, self._current_base), 'X'), 4, ' '))
        self.btn_dec.setText("{0:<8}".format('DEC') +
                             self.pretty(format(int(self._current_number, self._current_base), 'd'), 3, ','))
        self.btn_oct.setText("{0:<8}".format('OCT') +
                             self.pretty(format(int(self._current_number, self._current_base), 'o'), 3, ' '))
        self.btn_bin.setText("{0:<8}".format('BIN') +
                             self.pretty(format(int(self._current_number, self._current_base), 'b'), 4, ' ', True))

    def insert_in_display(self, button_txt):
        """
        This method have a responsibility for inserting the values in display.
        :param button_txt: receive the button_text
        :return: don't return anything.
        """
        self.operate(button_txt)  # This function have a responsibility for effectuate all logic of calculator.
        # If button is a number insert in display.
        if button_txt.isdigit() or button_txt in ('A', 'B', 'C', 'D', 'E', 'F', '00'):
            if len(str(self._current_number)) <= 10:
                self.display_calc.setText(self.pretty(str(self._current_number),
                                                      4 if self._current_base in (2, 16) else 3,
                                                      ',' if self._current_base == 10 else ' '))
        else:  # If button not is a number is a operator
            if button_txt == '=':
                if len(str(self._result_number)) > 10:
                    self.display_calc.setText('ERROR')
                else:
                    # self.display_calc.setText(format(self._result_number, self._base_map[self._current_base]))
                    self.display_calc.setText(self.pretty(str(self._current_number),
                                                          4 if self._current_base in (2, 16) else 3,
                                                          ',' if self._current_base == 10 else ' '))
            elif button_txt == 'CE':
                self.display_calc.setText('')
            elif button_txt == 'AC':
                self.display_calc.setText('0')
            elif button_txt == 'BACK':
                self.display_calc.setText(self.pretty(str(self._current_number),
                                                      4 if self._current_base in (2, 16) else 3,
                                                      ',' if self._current_base == 10 else ' '))

    def add_btn(self, btn, row, col, rowspan=0, colspan=0, function=None, style=None):
        """
        This method have a responsibility for inserting button in grid layout.
        :param btn: text in button.
        :param row: row in grid layout.
        :param col: column in grid layout.
        :param rowspan: default value is 0.
        :param colspan: default value is 0
        :param function: in case want add custom function for button.
        :param style: in case want add custom style for button.
        :return: don't return anything.
        """
        self.calcLayout.addWidget(btn, row, col, rowspan, colspan)
        if not function:
            btn.clicked.connect(
                lambda: self.insert_in_display(btn.text())
            )
        else:
            btn.clicked.connect(function)
        if style:
            btn.setStyleSheet(style)
        btn.setSizePolicy(QSizePolicy.Preferred, QSizePolicy.Expanding)
        self.check_base()
